import "./App.css";

function App() {
  // get data from API:

  async function fetchData() {
    const response = await fetch("https://jsonplaceholder.typicode.com/users");

    const users = await response.json();

    console.log(users);
  }

  return (
    <div className="App">
      <button onClick={fetchData}>Get Users' Names</button>

      <div>{users?.length > 0 ? users?.map( (user) => console.log(user)) : <p>No Users!</p>}</div>
    </div>
  );
}

export default App;
